import React from "react";

export default function Banner({ children, title, subtitle }) {
  return (
    <div className="col-md-12">
      <div className="col-md-6">
        <h1 className="text-center">{title}</h1><br/>
        <p className="text-center">{subtitle}</p>
      </div>

      {children}
    </div>
  );
}
